    }

    render() {
        return (
            <>
                <h1>Welcome !!!</h1>
                <div className="container">
                    Welcome {this.props.match.params.name}.
                    Please navigate here for Todos list <Link to="/todos"> Here </Link>
                </div>
                <div className="container">
                    click here to get the customized message.
                    <button onClick={this.retriveWelcomeMessage} className={""}>Get Welcome Message</button>
                </div>
            </>
        )
    }

    retriveWelcomeMessage() {
        console.log("retrive click")
    }
}

export default WelcomeComponent
